INSERT INTO `brand` (`brandId`, `brandName`, `status`, `imgPath`, `pinying`, `createDate`, `updateDate`, `createUserId`, `updateUserId`, `indexWord`, `rate`, `introduce`, `proImgs`, `brandTypeIds`, `brandRate`, `scanNum`) VALUES
('brand0', '19家', '1', '/imgStore/logo/19jia.png', 'shijiujia', NULL, NULL, NULL, NULL, 'S', 0.02, '上海致喜网络科技有限公司成立于2012年，是一家致力于家具、家居用品特卖的企业。其下属品牌www.19jia.com致力于做家居行业O2O电子商务平台的领跑者，同时是吉盛伟邦家居奥特莱斯唯一线上商城，并且自建位于青浦吉盛伟邦国际家具村内的7000平方线下体验中心，分为家具、布艺、灯饰、墙纸、地板、饰品、地毯等几大类，拥有国内外知名家具品牌数万款商品，为消费者提供了线上线下一站式家居用品购物体验。通过直接简洁的采购渠道，结合互联网理念及先进的销售方式，极大地压缩了采购、流通、销售成本，做到“大品牌、小价格”，真正让利给消费者。\r\n\r\n', '/imgStore/proImg/img143755370881472,/imgStore/proImg/img143755370881446,/imgStore/proImg/img143755370881473,/imgStore/proImg/img143755370881413', 'brandType143770259212008', 0.08, 721),
('brand10', '下午茶', '1', '/imgStore/logo/xiawucha.png', 'xiawucha', NULL, NULL, NULL, NULL, 'X', 0.02, '“下午茶”家具选用进口橡木材质，工艺上采用传统的手工雕花，将中国古典传统雕刻工艺用于欧式田园风格实木家具，表现了浪漫、温馨、舒适的家具风格，透露着浓郁的异国风情，是高雅与艺术的结合。\r\n', '/imgStore/proImg/img143755433437602,/imgStore/proImg/img143755433437719,/imgStore/proImg/img143755433437762,/imgStore/proImg/img143755433437732', 'brandType143770259212008', 0.08, 649),
('brand11', '傲耐家具', '1', '/imgStore/logo/aonai.png', 'aonaijiaju', NULL, NULL, NULL, NULL, 'A', 0.02, '竞争激烈的市场浪潮，忙碌的人都在为事业奔波，其实他们追求的仍是心灵深处“无风的港湾”——家。让你为家骄傲！感知人们的心声，体现傲耐人的创造精神——永远用一流的品质，真诚的服务与人们一同去构造骄傲的生活！傲耐以市场为中心，用高品质的产品去定义高品味的生活。让每一个拥有傲耐产品的人都拥有骄傲的家、骄傲的事业。为家而骄傲是每一个人对生活的追求；让你为家骄傲！是每一个傲耐人为致求美好生活的人作出的承诺——不仅仅是用产品，更是用真诚。', '/imgStore/proImg/img144722451514471,/imgStore/proImg/img144722451514625,/imgStore/proImg/img144722451514782,/imgStore/proImg/img144722451514797', 'brandType143770259212008', 0.08, 460),
('brand12', '奢世', '1', '/imgStore/logo/sheshi.png', 'sheshi', NULL, NULL, NULL, NULL, 'S', 0.02, '奢世家俬位于上海奉贤区新奉公路，公司拥有一万五千平方米的生产基地，以及包括三千平方米的实体展厅。是一家从专业研发，生产，到销售及代理的专业家具公司。公司凭着现代化的管理、先进的生产设备、精湛的工艺、卓越的品质、完善的服务赢得了客户的信赖。是国内知名从事家具设计、生产、销售一体化经营的家具企业。奢世家具突破了传统的设计理念，以独特新颖的设计、高贵典雅的风格、合理实的价格、优质完善的专业服务获得了一致好评。', '/imgStore/proImg/img143755349713509,/imgStore/proImg/img143755349713596,/imgStore/proImg/img143755349713691,/imgStore/proImg/img143755349713626', 'brandType143770259212008', 0.08, 472),
('brand13', 'ULIVI', '1', '/imgStore/logo/ulivi.png', 'ulivi', NULL, NULL, NULL, NULL, 'U', 0.02, '意大利家具Ulivi Salotti成立于1972年，公司位于托斯卡纳，在意大利中部佛罗伦萨。托斯卡纳是著名的华丽之都，是意大利文艺复兴的发祥地，也是意大利家具制造业相对集中的一个区。说到Ulivi Salotti无疑是意大利家具制造中极具代表性的作品，其高度的辨识性，一看之下，一股清新优雅的气息就扑面而来。一直保持着手工制作的特点，Ulivi Salotti通过使用天然真皮制作，使用从大自然提炼出的油漆、蜂蜡进行表面处理以及纯手工填充，为市场提供大量的环保产品。Ulivi Salotti是全球品牌承认的最好的意大利制造之一。我们会挑选最珍贵的芯材和真皮，并且每件产品的特殊设计和手工工艺质量都经过严格的把关。我们的产品一直很注重环保并符合环保标准。手工工艺与最先进的机械设备一起制作出最好最具耐久性的产品。我们结合手工技能和高级技术的双重概念为客户提供卓越的风格和质量', '/imgStore/proImg/img143755418554087,/imgStore/proImg/img143755418554003,/imgStore/proImg/img143755418554135,/imgStore/proImg/img143755418554134', 'brandType143770259212008', 0.08, 649),
('brand14', '猫王', '1', '/imgStore/logo/maowang.png', 'maowang', NULL, NULL, NULL, NULL, 'M', 0.02, '猫王是德国原创的钢木家具，可以灵活组合，自由搭配，适合任何空间，最主要的可以根据你家尺寸量身设计。猫王24年始终如一，专业于钢木领域，专注于空间利用，专心于客户价值，铸就了钢木家具领导品牌的行业地位。为了实现最优秀的客户居家体验，猫王在选材与工艺上精耕细作，在生产与质量管理上精益求精，接轨欧洲EHS环保标准，遵循国际ISO9001质量管理体系，力求达到与德国原创理想设计之间的平衡，成就优良的产品品质。', '/imgStore/proImg/img143755091237195,/imgStore/proImg/img143755091237202,/imgStore/proImg/img143755091237296,/imgStore/proImg/img143755091237222', 'brandType143770259212008', 0.08, 558),
('brand143739771868939', '大普', '1', '/imgStore/logo/img143749291578568', 'dapu', '2015-07-20 21:08:38', NULL, 'user143671110894048', NULL, 'D', 0.02, '大普系列产品是楷模公司2006新推出的新现代品牌系列产品，其设计风格明快，追求简炼、浪漫、单纯和抽象的风格，融合强烈的时代感，并给追求高品味生活的人群带来居家新概念！源自意大利著名家具设计师米诺蒂的手笔，风格融合欧式家具意念和东方文化特色，尤其以其设计精巧、摆放的灵活多变、最大限度合理利用空间而令人叫绝。其中的沙发和茶几曾连续三次在全球最大家具展——美国高点家具展上荣获金奖。大普家具全部申请专利以后才在全球市场上推出，2006年前，大普只供出口，自国内上市以来在上海、深圳、广州等地引起了不小的震动.', '/imgStore/proImg/img143755600358337,/imgStore/proImg/img143754809013463,/imgStore/proImg/img143754809013467,/imgStore/proImg/img143754809013554', 'brandType143770259212008', 0.1, 535),
('brand143739796618908', '大术', '0', '/imgStore/logo/img143749315484818', 'dashu', '2015-07-20 21:12:46', NULL, 'user143671110894048', NULL, 'D', 0.02, '大术是东莞市楷模家居用品制造有限公司旗下的欧式风格家具品牌，楷模家居是一家新近崛起的、致力于现代化家具生产的专业性公司。公司成立于2003年，位于被誉为中国“家具之都”的东莞厚街，地处家具大道中段。拥有9间大型工厂，总建筑面积33.5万平方米，现有员工2600多人。公司拥有多条德国、意大利等国进口的先进生产流水线，制造出高品质的民用家具，并在成长中不断求发展。公司依靠地缘优势并通过自身的科学机制培养了一个经得起磨练、考验又具有丰富生产、设计经验的高效团队。并拥有先进的机械设计生产线，技术力量雄厚。研制、开发生产能力活动、设计高雅、实用、选材优质。并经技术监督部门检验。', '/imgStore/proImg/img143754828528633,/imgStore/proImg/img143754828528605,/imgStore/proImg/img143754828528666,/imgStore/proImg/img143754828528763', 'brandType143770259212008', 0.1, 581),
('brand143739805104372', '拿铁', '1', '/imgStore/logo/img143749520037569', 'natie', '2015-07-20 21:14:11', NULL, 'user143671110894048', NULL, 'N', 0.02, '拿铁系列家具是楷模公司又一新品系列，这是一套新贵系列款式家具，无论家具的在设计上，颜色上都与前系列不同，又为楷模增添一朵鲜艳的花朵！拿铁系列家具整体感觉非常有震撼力，因为从当前最具个性化的角度上面，他们把家具的功能跟整个的设计很完美地结合在一起，不仅仅重视了家具款式外观的美，同时他也从家具的使用方面下了很多的功夫。', '/imgStore/proImg/img143755247009089,/imgStore/proImg/img143755247009069,/imgStore/proImg/img143755247009184,/imgStore/proImg/img143755247009105', 'brandType143770259212008', 0.1, 550),
('brand143739823868429', '梵蒂尼', '1', '/imgStore/logo/img143749339019537', 'fandini', '2015-07-20 21:17:18', NULL, 'user143671110894048', NULL, 'F', 0.02, '梵蒂尼致力用科技提高睡眠质量，研发多项世界领先技术和专利产品，以最高标准引领睡眠行业，为健康缔造更好睡眠！', '/imgStore/proImg/img143754860147194,/imgStore/proImg/img143754860147266,/imgStore/proImg/img143754860147281,/imgStore/proImg/img143754860147228', 'brandType143770259212008', 0.1, 664),
('brand143739836622818', '圣萝莎家纺', '1', '/imgStore/logo/img143749548041136', 'shengluoshajiafang', '2015-07-20 21:19:26', NULL, 'user143671110894048', NULL, 'S', 0.02, '“圣萝莎家纺”是由东莞圣萝莎家居用品制造有限公司和意大利圣萝莎家居制造有限公司联合出品。公司位于被誉为“家具之都”的东莞厚街。厂区是园林设计，从德国、意大利引进多条先进生产线。公司以“树百年楷模，创一流品牌”为企业目标，不断的开拓创新，在行业内已树立良好口碑，现已在各大城市建立销售网点，产品远销欧美及东南亚等地区。', '/imgStore/proImg/img143755332619936,/imgStore/proImg/img143755332620085,/imgStore/proImg/img143755332620039,/imgStore/proImg/img143755332620036', 'brandType143770242970977', 0.1, 325),
('brand143739926429924', '摇篮', '1', '/imgStore/logo/img143749635704280', 'yaolan', '2015-07-20 21:34:24', NULL, 'user143671110894048', NULL, 'Y', 0.02, '摇篮——具有颠覆性的青少年儿童家具！用独特的设计填补了中国儿童家具市场的空白！是由中国最具实力和规模的楷模家居用品制造集团公司生产。\r\n摇篮——以健康环保为核心，以节省空间为基础，用趣味性打破传统，更加注重孩子们的智力开发，并从空间上去影响孩子们的思维格局。\r\n摇篮——给宝贝们营造健康、快乐、有趣的成长环境！为青少年儿童的健康成长护航！ \r\n从摇篮走向成功！', '/imgStore/proImg/img143755454130680,/imgStore/proImg/img143755454130630,/imgStore/proImg/img143755454130683,/imgStore/proImg/img143755454130759', 'brandType143770324715444', 0.1, 466),
('brand143745752228323', '曲美', '1', '/imgStore/logo/img143749537129524', 'qumei', '2015-07-21 13:45:22', NULL, 'user143671110894048', NULL, 'Q', 0.02, '曲美家居经过29年稳健发展，成为中国领先的集设计、生产、销售于一体的大型、规范化家具集团。秉承"用设计创造生活"的品牌理念，已成为中国最具设计感的现代家具品牌。在全国各大城市都有专卖店，光大型独立商场就有200多家。落户上海已经20年，在红星美凯龙、吉盛伟邦等商场均有专卖店。', '/imgStore/proImg/img143755298241898,/imgStore/proImg/img143755298241925,/imgStore/proImg/img143755298241995,/imgStore/proImg/img143755298241940', 'brandType143770259212008', 0.05, 489),
('brand143745780341985', '挪亚家', '1', '/imgStore/logo/img143749526104477', 'nuoyajia', '2015-07-21 13:50:03', NULL, 'user143671110894048', NULL, 'N', 0.02, ' 挪亚家家具采用模块化的设计，用户可以根据自己的要求自由组合，设计出属于自己的独特的家居空间，目前主要分五大系列:第三空间、NORYA-D5、NORYA-D6、NORYA-D8、拜茵系列，各系列的产品涵盖:客厅家具，卧室家具，餐厅家具，书房家具等。', '/imgStore/proImg/img143755266358463,/imgStore/proImg/img143755266358542,/imgStore/proImg/img143755266358554,/imgStore/proImg/img143755266358558', 'brandType143770259212008', 0.08, 464),
('brand143745835609353', '和木居', '1', '/imgStore/logo/img143749375316217', 'hemuju', '2015-07-21 13:59:16', NULL, 'user143671110894048', NULL, 'H', 0.02, '和木居新实木主义，都市慢生活缔造者原创经典、醇美实木，浓郁美式田园、地中海风情完美呈现。\r\n【和木居】上海吉盛伟邦家具村旗舰店占地1200平米，近百款实木家具场景展示，展厅有美栖、美筑、醇美假日三大系列。\r\n', '/imgStore/proImg/img143754995922852,/imgStore/proImg/img143754995922867,/imgStore/proImg/img143754995922992', 'brandType143770259212008', 0.06, 331),
('brand143746986905880', '格林小镇', '1', '/imgStore/logo/img143749361095783', 'gelinxiaozhen', '2015-07-21 17:11:09', NULL, 'user143671110894048', NULL, 'G', 0.02, '英式田园风格，它摒弃了欧式家具惯有的奢华和繁琐，强调“回归自然”的设计理念，运用独特的创意思维、人文色彩的设计灵感，及精益求精的手工制作，使产品本身超越了历史演变的概念，成为艺术精髓的结晶和舒适生活品质的象征。主材采用美国进口极品白橡木，其极具装饰性的原木纹理，坚质地，超强的耐腐、耐磨性能，将格林小镇完美无瑕的品质诠释。', '/imgStore/proImg/img143754957864744,/imgStore/proImg/img143754957864729,/imgStore/proImg/img143754957864842,/imgStore/proImg/img143754957864891', 'brandType143770259212008', 0.06, 533),
('brand143747126466003', '美欧美家', '1', '/imgStore/logo/img143749450962079', 'meioumeijia', '2015-07-21 17:34:24', NULL, 'user143671110894048', NULL, 'M', 0.02, '美欧美家系列家具精选产自美国的珍贵黑胡替桃木，做工精致，用料考究，产自北美，是价值最高的阔叶木品种之一，木质坚硬，纹理清晰，有光泽，弦切面为美丽的大山纹，形成赏心悦目的装饰图案，是最优良的家具用材之一。\r\n设计着将传统的经典元素同现代建筑元素完美融合，圆滑的线条，优美的弧度。把胡桃木家具独有的内涵和气质演绎的淋漓尽致。低调奢华，为现代人营造出闲适写意的生活空间\r\n', '/imgStore/proImg/img143755107899013,/imgStore/proImg/img143755107899009,/imgStore/proImg/img143755107899175,/imgStore/proImg/img143755107899193', 'brandType143770259212008', 0.06, 467),
('brand143747171582777', '南洋胡氏', '1', '/imgStore/logo/img143749500090036', 'nanyanghushi', '2015-07-21 17:41:55', NULL, 'user143671110894048', NULL, 'N', 0.02, '南洋胡氏是中国驰名商标十大实木品牌，具有22年专注于专业打造全实木家具的工厂。\r\n南阳胡氏的家具作品不仅是表达个人生活方式的工具，而且是以优雅外观，体现超卓工艺的美学创作，其设计能够在滚滚而逝的时尚、洪流岿然不动与现代气息。南阳胡氏树立了低调内敛，永恒优雅的独特风格，完美的融合了个性与稳重，优雅与高贵这种诞生出设计简约，个性鲜明，线条优美的一件件艺术品，如果把家具比作艺术收藏品，那么一块好的木材是这艺术品的载体，而精雕细琢的设计，才是这艺术品的内容，从而确保其性能一如既往的可靠，代代相传。\r\n', '/imgStore/proImg/img143755229198828,/imgStore/proImg/img143755229198974,/imgStore/proImg/img143755229198964', 'brandType143770259212008', 0.06, 574),
('brand143747261399496', '柚至臻', '1', '/imgStore/logo/img143749657968202', 'youzhizhen', '2015-07-21 17:56:53', NULL, 'user143671110894048', NULL, 'Y', 0.02, '至尊柚木，传承经典，精选野生缅甸柚木，现代加工工艺，结合东南亚与中国传统文化，提取内在经典，演绎在家具灵魂中，使每款家具都享有独特的艺术灵性气质。', '/imgStore/proImg/img143755540928676,/imgStore/proImg/img143755540928664,/imgStore/proImg/img143755540928600,/imgStore/proImg/img143755540928651', 'brandType143770259212008', 0.06, 554),
('brand143747349083399', '利豪', '1', '/imgStore/logo/img143749441909881', 'lihao', '2015-07-21 18:11:30', NULL, 'user143671110894048', NULL, 'L', 0.02, '利豪集团成立于1999年，一直专注于皮沙发的生产。被评委中国十大沙发品牌之一，2010年上海世博会国家馆贵宾厅选用产品，同年进驻北京故宫菁英展。2008年签约影视巨星陈道明一直至今，连续4次签约为利豪代言。', '/imgStore/proImg/img143755071948105,/imgStore/proImg/img143755071948247,/imgStore/proImg/img143755071948274,/imgStore/proImg/img143755071948291', 'brandType143770240702051', 0.06, 352),
('brand143761982064725', '金雅斯', '1', '/imgStore/logo/img143761982061820', 'jinyasi', '2015-07-23 10:50:20', NULL, 'user143671110894048', NULL, 'J', 0.02, '金雅斯家具有限公司成立于1996年。是一家引进国外先进家具生产设备及生产技术的企业，唯美风情系列产品选用白蜡木做为主材，文理清晰漂亮，同类产品性价比最高。公司销售网络遍布全国，产品远销欧美，东南亚等海外国家和港澳台地区。', '/imgStore/proImg/img143761982062003,/imgStore/proImg/img143761982062004,/imgStore/proImg/img143761982062132,/imgStore/proImg/img143761982062150', 'brandType143770259212008', 0.06, 951),
('brand143765132038760', 'HTL', '1', '/imgStore/logo/img143765132038556', 'HTL', '2015-07-23 19:35:20', NULL, 'user143671110894048', NULL, 'H', 0.02, 'HTL集团1976年创始于新加坡，1993年在新加坡证券交易所成功上市。经过近40年的不断扩展，如今HTL集团已分别在江苏昆山、淀山湖、常熟、扬州和淮安拥有超过50万平方米的全球一体化产业链制造基地，每个月有超过2000个货柜的沙发出口到全世界。在竞争激烈的国际家居市场中，HTL产品力求创新的设计和高效专业的生产技术，不断造就业界经典。如今，HTL已成为全球最大、最值得信赖的皮革软体家具制造商之一。全球员工超过7000名，家居产品远销世界50多个国家5000多家零售门店，真正成为全球亿万家庭“创新生活的领导者”。\r\n\r\n截止2015年，HTL在全国已开设近90家品牌专卖店，其中在上海、江苏共开设六家直营专卖店，上海4家，苏州和昆山各一家。上海的芷江路旗舰店和昆山的港龙店，直营面积都将近3000平米，售卖家居产品近千款。HTL在中国正更加迅猛的发展中。\r\n', '/imgStore/proImg/img143765132038553,/imgStore/proImg/img143765132038604,/imgStore/proImg/img143765132038665,/imgStore/proImg/img143765132038674', 'brandType143770240702051', 0.08, 724),
