('brand143797704268458', '英伦美家', '1', '/imgStore/logo/img143797704265103', 'yinglunmeijia', '2015-07-27 14:04:02', NULL, 'user143671110894048', NULL, 'Y', 0.02, '英伦美家，十年专注整体软装，致力于英式家居文化和欧洲生活方式的传播，为精英人士提供高品位的整体软装解决方案，打造优雅时尚的家居空间。\r\n    从专业的软装设计，到高品质的家具、布艺，墙纸，配饰，再到用心创造感动的“英式管家”服务，美好轻松的置家体验，带给更多家庭美丽与幸福！\r\n', '/imgStore/proImg/img143797704265281,/imgStore/proImg/img143797704265396,/imgStore/proImg/img143797704265356,/imgStore/proImg/img143797704265484', 'brandType143770259212008', 0.08, 654),
('brand143798093686473', '芝华仕', '1', '/imgStore/logo/img143798093686282', 'zhihuashi', '2015-07-27 15:08:56', NULL, 'user143671110894048', NULL, 'Z', 0.02, '芝华仕沙发是敏华控股（HK01999）旗下非常具影响力的家居品牌，也是全球沙发行业的领导者。是软体沙发行业唯一一家上市公司，从第一套芝华仕沙发诞生至今，全球已有超过千万户家庭享受着芝华仕沙发带来的舒适健康生活。芝华仕沙发更连续多年稳坐中国十大沙发品牌龙头交椅。在美国的销量更是排行前三，年出口额超过50亿。', '/imgStore/proImg/img143798093686276,/imgStore/proImg/img143798093686237,/imgStore/proImg/img143798093686328,/imgStore/proImg/img143798093686364', 'brandType143770240702051', 0.06, 695),
('brand143832751098595', '杜莎家具', '0', '/imgStore/logo/img143832751093223', 'dushajiaju', '2015-07-31 15:25:10', NULL, 'user143671110894048', NULL, 'D', 0.02, '杜莎家具是首家现代全实木美式家居品牌，D.U.S.A精选北美进口金丝黄杨，纯手工雕刻，感受力量与柔美的完美结合，打造清新空间的别样温馨。在崇尚健康舒适、快乐清新的氛围引导下，杜莎D.U.S.A帮助当代忙碌的都市人群拥有一份“家”的生活信仰！', '/imgStore/proImg/img143832751093217,/imgStore/proImg/img143832751093363,/imgStore/proImg/img143832751093397,/imgStore/proImg/img143832751093380', 'brandType143770259212008', NULL, 0),
('brand143833870846350', '简·美居家', '1', '/imgStore/logo/img143835740853186', 'jianmeijujia', '2015-07-31 18:31:48', NULL, 'user143671110894048', NULL, 'J', 0.02, '简·美居家采用北美进口白橡木打造的纯实木精装家具，不仅表面木材的花纹清晰优美，而且在造型上朴实大方，线条饱满流畅，以其朴实无华的质感、栩栩如生的纹理、清纯靓丽的色泽，把家居环境装点的素雅、纯净.', '/imgStore/proImg/img143835847711767,/imgStore/proImg/img143835847711846,/imgStore/proImg/img143835847711832,/imgStore/proImg/img143835847711817', 'brandType143770259212008', 0.06, 1467),
('brand143866207061615', 'COCO-MAT', '1', '/imgStore/logo/img143866207060995', 'COCO-MAT', '2015-08-04 12:21:10', NULL, 'user143671110894048', NULL, 'C', 0.02, 'COCO-MAT遵循大自然的法则摒弃金属弹簧, 所有产品均使用大自然赐予我们的椰果纤维、天然乳胶、马毛、海草、羊毛等纯天然原材料手工精作而成。\r\nCOCO-MAT立志为客户提供世界上最好的床，坚持向世人传播着“sleep on nature”的生活理念；目前已在全球十四个重要经济体国家设有品牌旗舰店，并为全球最奢华的安缦酒店、阿提哈德航空等具有行业标杆性公司供应产品。\r\n', '/imgStore/proImg/img143866207061146,/imgStore/proImg/img143866207061143,/imgStore/proImg/img143866207061284,/imgStore/proImg/img143866207061260', 'brandType143770259212008', 0.08, 242),
('brand143893228070039', '汉乐府', '1', '/imgStore/logo/img143893228068082', 'hanlefu', '2015-08-07 15:24:40', NULL, 'user143671110894048', NULL, 'H', 0.02, '“汉乐府”在中国红木家具发祥地——苏州常熟专业从事设计、生产、销售红木家具已有20余年的历史。并于2008年在上海设立总部上海汉乐府家具有限公司，总部拥有上海市最大的红木卖场展厅，位于吉盛伟邦国际家具村， 展厅面积近2000平米，也是全国最大红木卖场展厅。“汉乐府”立足于上海，面向全国，更好的传承发扬中国古典红木家具艺术文化。 \r\n       常熟位于江南古城，背倚长江，人文荟萃，历代文人墨客辈出，能工巧匠云集，为红木文化发展打下坚实的文化基础，也为华夏文明增添了许多文化艺术瑰宝！其中以红木家具的工艺魅力最为使人折服，是品味江南文化的点睛。 常熟红木兴起于明代后期，当年苏州文人士大夫与班门匠师率先携手，打造出工艺精良，意蕴风雅的红木家具，在晚明被达官贵族誉为“文木雅器”，由此被天下人追慕。而后流向京畿，得到宫廷宠幸，使得故园中融入了江南的诗 情画意，因而被京城官宦呼为“苏作”。“汉乐府”红木家具完全传承了“苏作”工艺，成为延展江南文脉的一支，亦是为前人开创的江南红木文化续脉。 　　\r\n       “苏作”以追求清新，秀雅风韵为特点。以其清雅，委婉之风，潜移默化的显示出“苏作”红木家具的审美和风格，充分体现江南水乡的俊雅！而这些都在“汉乐府”的红木家具里一一展现。不仅如此，“苏作”还以其精湛的工 艺闻名于世，匠师们继承和发扬了中国特有的“鲁班榫”技艺，不用一钉一镙亦可打造完美家具，更为可贵的是历经百年而能使用如新。“汉乐府”的匠师多数师承父辈，有着心手相传的传统，“汉乐府”红木的一桌一椅无不体现其 传统工艺的严谨和精湛。', '/imgStore/proImg/img143893228068219,/imgStore/proImg/img143893228068300,/imgStore/proImg/img143893228068335', 'brandType143770259212008', 0.08, 684),
('brand143893575429561', '雅木', '1', '/imgStore/logo/img143893575429432', 'yamu', '2015-08-07 16:22:34', NULL, 'user143671110894048', NULL, 'Y', 0.02, '“雅木”品牌是中国家具行业实木家具品牌中最具影响力的品牌之一，公司本着以打造‘中国乌金木专家’的企业愿景和‘中国品质看雅木’的品牌诉求，将‘产品就是人品’做为企业的产品价值观，建立了一套低碳生态、现代化、高效、品质领先的从原材料采购到终端顾客上门服务的采购、生产、销售、服务体系，将口碑效应作为雅木产品营销的特点。公司主营乌金木民用套房家具，有现代风格、法式古典风格、简美风格、小法式风格、休闲实木风格等5大类乌金木系列家具，是一家专业制造乌金木家具，以工艺领先专注做全实木的家具企业，是长三角华东地区实木家具企业的领导者。产品推崇引领奢华、精致品质生活的设计风格及功能一体化设计，采用源自非洲、亚热带地区植物活化石‘乌金木’高端硬木，雅木家具经过8年全实木家具制造的历史沉淀，产品工艺国内遥遥领先。广受客户好评及推崇，深受消费者喜爱。', '/imgStore/proImg/img143893660852338,/imgStore/proImg/img143893660852455,/imgStore/proImg/img143893660852492,/imgStore/proImg/img143893575429422', 'brandType143770259212008', 0.08, 627),
('brand143893646997253', '臻致美', '1', '/imgStore/logo/img143893646996958', 'zhenzhimei', '2015-08-07 16:34:29', NULL, 'user143671110894048', NULL, 'Z', 0.02, '臻致美实木家具以外观华丽典雅，选料精致考究，做工精细致密，选用高档材料，辅以流畅的线条，独创清新，柔美，俊朗之格调，追求动感个性，展现出华贵与高尚的格调，将豪门之家的非凡气度，提升一个崭新的境界。艺术的灵动，娴熟的技艺，一流的生产管理。设计者遵从东方的古韵，以结构主义美学指导创作，把工艺的精湛，线条的流动与结构的简约性奇妙的统一起来。给人以天然浑成之感，给追求生活质量和品位的人士，提供充分展示其个性与鉴赏力的空间。', '/imgStore/proImg/img143893694800015,/imgStore/proImg/img143893646997048,/imgStore/proImg/img143893646997159,/imgStore/proImg/img143893646997177', 'brandType143770259212008', 0.08, 264),
('brand143943541909516', '凯特猫推荐', '1', '/imgStore/logo/img143943541901107', 'kaitemaotuijian', '2015-08-13 11:10:19', NULL, 'user143671110894048', NULL, 'K', 0.02, '测试专用', '/imgStore/proImg/img143952686850575,/imgStore/proImg/img143952686850721,/imgStore/proImg/img143952686850803,/imgStore/proImg/img143952686850835', 'brandType143770259212008', 0.1, 3),
('brand144108038442506', '艾美家', '1', '/imgStore/logo/img144108038442079', 'aimeijia', '2015-09-01 12:06:24', NULL, 'user143671110894048', NULL, 'A', 0.02, '艾美家以开放，创新的设计思维，摒弃了传统家具复杂的肌理与装饰，融合了天然木材之精华，高档的涂装工艺映衬出木材炽热，柔和的纹理，其优雅流畅的线条轮廓，尊贵质感的软装布艺，浑然天成的视觉美感，让人强烈的感受到传统的历史痕迹与文化底蕴。品质、生活与追求三大主题将在艾美家中得到尽善尽美的诠释与承载。', '/imgStore/proImg/img144108038442247,/imgStore/proImg/img144108038442266,/imgStore/proImg/img144108038442354,/imgStore/proImg/img144108038442314', 'brandType143770259212008', 0.06, 293),
('brand144108087954899', '玫瑰花语', '1', '/imgStore/logo/img144108087954655', 'meiguihuayu', '2015-09-01 12:14:39', NULL, 'user143671110894048', NULL, 'M', 0.02, '玫瑰花语系列是一款法式新古典家具，法式家具在色彩上以素净、单纯与质朴见长。爱浪漫的法国人偏爱明亮色系，以米黄，白，原色为最多，所以有人称法式家具为“感性家具”。玫瑰花语既传承了古典主义的精华又结合了现代家具的舒适感，它注重体现曲线，靠背、扶手、椅腿与外框大多采用细致典雅的雕花，不同于洛可可式家具繁复的雕刻和不菲的价格，法式新古典家具以以其简洁的设计、流畅的线条以及高性价比得到了越来越多消费者的认可和推崇。', '/imgStore/proImg/img144108087954677,/imgStore/proImg/img144108087954755,/imgStore/proImg/img144108087954720,/imgStore/proImg/img144108087954788', 'brandType143770259212008', 0.06, 557),
('brand144179308455470', '左右沙发', '1', '/imgStore/logo/img144179308452532', 'zuoyoushafa', '2015-09-09 18:04:44', NULL, 'user143671110894048', NULL, 'Z', 0.02, '左右沙发创建于1986年，至今已有29年的发展历史，总部位于广东深圳，是一家集研发、生产和销售沙发为主的大型家私企业，拥有管理、技术等各类人才共3300多名，在全国有2000多家专卖店。   \r\n作为国内沙发的领导者，亚洲最大的沙发专业制造商之一，左右沙发以时尚、潮流、实用、人性化的设计帮助万千家庭打造一个舒适、健康、理想的家居生活空间。多次获得国际家具展览会的冠军，是目前国内沙发市场占有率最高的知名品牌。\r\n', '/imgStore/proImg/img144179308452732,/imgStore/proImg/img144179308452832,/imgStore/proImg/img144179308452874', 'brandType143770240702051', 0.08, 34),
('brand144238171582493', '牛蛙沙发', '1', '/imgStore/logo/img144238171582118', 'niuwashafa', '2015-09-16 13:35:15', NULL, 'user143671110894048', NULL, 'N', 0.02, '德国牛蛙沙发体现更多人文关怀是现代社会需求，非凡的创造力是我们的设计基础。二十多年来我们为超过60个国家的人们提供其钟爱的产品，让每一位使用者以自己喜欢的方式生活在自己喜欢的环境之中，德国牛蛙沙发把微笑带回家……', '/imgStore/proImg/img144238171582262,/imgStore/proImg/img144238171582270,/imgStore/proImg/img144238171582250,/imgStore/proImg/img144238171582317', 'brandType143770240702051', 0.08, 8),
('brand144238243045878', '格调沙发', '1', '/imgStore/logo/img144238243045638', 'gediaoshafa', '2015-09-16 13:47:10', NULL, 'user143671110894048', NULL, 'G', 0.02, '格调沙发以现代家居生活为主体的家庭家私制造典范，始终秉承“家居生活，追求格调”的价值理念，致力于为消费者提供高品质的家居产品和舒适温馨的家居文化。旗下品牌“色全色美”布艺沙发，“格调时代”真皮休闲系列沙发，以及新晋品牌“纯美”“魅丽”软床系列，深受广大消费者的喜爱，连续多年获得“最受消费者喜爱奖”、“中国绿色环保名优产品”等诸多奖项。目前公司销售网点遍布全国100多个城市，终端销售门店400多家，产品远销美国、加拿大、英国、韩国、日本中东及东南亚等国家和地区，为全球超200万用户提供舒适温馨的高品质家居。', '/imgStore/proImg/img144238243045664,/imgStore/proImg/img144238243045702,/imgStore/proImg/img144238243045776,/imgStore/proImg/img144238243045849', 'brandType143770240702051', 0.08, 16),
('brand144238347801696', '穗宝床垫', '1', '/imgStore/logo/img144238347801499', 'suibaochuangdian', '2015-09-16 14:04:38', NULL, 'user143671110894048', NULL, 'S', 0.02, '1971年，中国第一张弹簧软床垫在穗宝诞生。至今，企业主营产品穗宝牌弹簧软床垫，已畅销中国四十余年，累计直接用户超过1000万，深受全国广大消费者的喜爱和信赖。', '/imgStore/proImg/img144238347801531,/imgStore/proImg/img144238347801578,/imgStore/proImg/img144238347801574,/imgStore/proImg/img144238347801520', 'brandType143770242970977', 0.08, 7),
('brand144238724165629', '茉莉花香', '1', '/imgStore/logo/img144238724165446', 'molihuaxiang', '2015-09-16 15:07:21', NULL, 'user143671110894048', NULL, 'M', 0.02, '茉莉花香家具针对的用户群是广大的年轻朋友和年轻的夫妇，茉莉花香家具无不显示了现代、简约、时尚的韩式生活主张，在细节处体现精致。茉莉花香韩式家具是国内首家顺应时代需要、市场需要而对特定人群所开设以及成立的白色婚庆家具。茉莉花香韩式家具有着简约清新的特点，市场销量非常好，给家庭带来精致的、浪漫的、温馨的、宁静的、自然高贵居室生活。', '/imgStore/proImg/img144238724165440,/imgStore/proImg/img144238724165589,/imgStore/proImg/img144238724165501,/imgStore/proImg/img144238724165596', 'brandType143770259212008', 0.08, 10),
('brand144273847951914', '哥伦比尼', '1', '/imgStore/logo/img144273847951899', 'gelunbini', '2015-09-20 16:41:19', NULL, 'user143671110894048', NULL, 'G', 0.02, '哥伦比尼家具的卓尔不群在于提供极高品质的产品和服务，其表现在：\r\n●	以最具竞争力的价格给市场提供意式设计的顶级质量的产品。\r\n●	尊重环境，选择最健康的材料和制造方式。\r\n●	对时尚的引领核对消费者需求的固定关注。\r\n●	高效的、值得信赖的制造工艺及过程。\r\n', '/imgStore/proImg/img144273847951889,/imgStore/proImg/img144273847951839,/imgStore/proImg/img144273847951929,/imgStore/proImg/img144273847951950', 'brandType143770324715444', 0.08, 14),
('brand144290441777281', '柏逸轩', '1', '/imgStore/logo/img144290441775137', 'boyixuan', '2015-09-22 14:46:57', NULL, 'user143671110894048', NULL, 'B', 0.02, '上海柏逸轩家具有限公司是集产品开发,制造及市场营销于一体的现代化家具企业。公司拥有完善的生产体系和先进的生产设备，旗下品牌柏逸轩自2006年初推出的一系列实木家具。在设计理念上吸取传统文化精髓，与现代时尚家居生活理念相结合，以其自然、朴实、唯美和谐的风格，像我们展示另一种和谐的生活方式，为当代人们创造出返朴归真，回归自然的生活气息。我们期待您对我们产品的收藏，以及感谢您对我们品牌的支持。', '/imgStore/proImg/img144290441775212,/imgStore/proImg/img144290441775393,/imgStore/proImg/img144290441775388,/imgStore/proImg/img144290441775451', 'brandType143770259212008', 0.08, 22),
('brand144314973137827', '华泰办公家具', '1', '/imgStore/logo/img144314973135657', 'huataibangongjiaju', '2015-09-25 10:55:31', NULL, 'user143671110894048', NULL, 'H', 0.02, '上海华泰木业制品有限公司，是一间集家具制造、销售及家具工程配套一体的现代中高档办公系列家具的规模模型企业。', '/imgStore/proImg/img144314973135830,/imgStore/proImg/img144314973135998,/imgStore/proImg/img144314973135941,/imgStore/proImg/img144314973136086', 'brandType143770330830468', 0.08, 3),
('brand144316082905923', '喜梦宝', '1', '/imgStore/logo/img144316082905608', 'ximengbao', '2015-09-25 14:00:29', NULL, 'user143671110894048', NULL, 'X', 0.02, '喜梦宝为厦门优客居品牌管理有限公司旗下中高端家具品牌，1988年诞生，27年的实木家具生产史，以生产优质实木的儿童家具著称，在同行业中取得了令人瞩目的成就。产品远销海内外。\r\n先后荣获“中国十大青少年儿童家具品牌”“中国十大实木家具品牌”“中国驰名商标”等荣誉称号。\r\n', '/imgStore/proImg/img144316082905641,/imgStore/proImg/img144316082905752,/imgStore/proImg/img144316082905787,/imgStore/proImg/img144316082905759', 'brandType143770324715444', 0.05, 12),
('brand144454231487349', '乐家', '0', '/imgStore/logo/img144454231484981', 'lejia', '2015-10-11 13:45:14', NULL, 'user143671110894048', NULL, 'L', 0.02, 'Roca乐家产品遍及全球135个国家和地区，深受全世界消费者的一致青睐。百年来，Roca乐家传承欧洲设计精粹，云集国际顶尖设计大师，融合全新科技，不断推陈出新，为消费者提供品质卓越和设计环保的产品。Roca乐家以创新、设计、环保和注重生活品质为品牌核心价值，在巴塞罗那设立全球设计中心和创新实验室，始终坚持技术和设计创新。', '/imgStore/proImg/img144454231485169,/imgStore/proImg/img144454231485112,/imgStore/proImg/img144454231485290,/imgStore/proImg/img144454231485251', 'brandType143770259212008', 0.08, 0),
('brand144454598743286', '赛林娜', '1', '/imgStore/logo/img144454598742952', 'sailinna', '2015-10-11 14:46:27', NULL, 'user143671110894048', NULL, 'S', 0.02, '上海赛林娜家具有限公司成立于2000年,2004年创建并成功注册了“赛林娜”品牌。十多年来“赛林娜”品牌得到了众多商场的认可和支持，也得到了广大用户的青睐。我们将一如既往、脚踏实地、继续认真的经营维护我们的“赛林娜”品牌，更好的为广大用户服务，为广大用户提供健康、舒适的床垫。', '/imgStore/proImg/img144454598742929,/imgStore/proImg/img144454598743039,/imgStore/proImg/img144454598743075,/imgStore/proImg/img144454598743187', 'brandType143770242970977', 0.08, 5),
('brand144963749848649', '西娅图', '1', '/imgStore/logo/img144963749846462', 'xiyatu', '2015-12-09 13:04:58', NULL, 'user143671110894048', NULL, 'X', 0.02, '西娅图—来自美国天使梦家居集团，旗下拥有西娅图—美式总统寝具、西娅图-总统套房睡眠系统两大系列。总部的Angel dream品牌在全球50多个国家都有品牌代理商。\r\n西娅图是全球50多家四星级、五星级酒店床垫、床具的供应商。近期项目有嘉兴华美达酒店、青岛香格里拉酒店、杭州玉皇山上的高端私人会所等；西娅图公司是一家从弹簧、辅料、面料都自主研发、设计、生产的公司！制造标准符合国标的同时、严格按照美国生产标准、欧洲环保标准执行！\r\n独创的九区护脊睡眠系统、循环透气系统，大大的改善了消费者的睡眠品质！\r\n西娅图床垫内部结构质保二十年！二十年内出现塌陷变形免费维修！\r\n', '/imgStore/proImg/img144963749846661,/imgStore/proImg/img144963749846642,/imgStore/proImg/img144963749846774,/imgStore/proImg/img144963749846787', 'brandType143770242970977', 0.08, 2),
('brand1451368612974636', '吉盛伟邦', '1', '/imgStore/logo/img145136861297330', 'jishengweibang', '2015-12-29 13:56:52', NULL, 'user143671110894048', NULL, 'J', 0.02, '吉盛伟邦国际家具村元旦活动专用', '/imgStore/proImg/img145136861297301', 'brandType143770259212008', 0.04, 13),
('brand15', '阅梨', '1', '/imgStore/logo/yueli.png', 'yueli', NULL, NULL, NULL, NULL, 'Y', 0.02, '“阅梨”，意为品阅梨木，谐音“阅历”，意味着隽永的历史沉淀需细细品味。每一件梨木家具都有自己的名字和故事，它不单单是一件家具，还是一件极具韵味和收藏价值的艺术品。每件作品既满足了现代人对舒适性和实用性的要求，又能通过线条的设计神奇的保留一份古朴的神韵。 \r\n阅梨家私主张“中国的、时尚的”。在全世界都为东方文化所着迷的时候，设计潮流不可避免的融汇了中国古典的文化之素。当然，重提旧日的东西并不是生搬硬用，而是取其精髓，混搭当下流行的现代元素，时尚的演绎，彰显出时代的生活态度。“阅梨”设计的时候润物无声般融入了中国古典家具的古韵气质与迷人元素。处处贵而不娇、含蓄内敛、奢华低调\r\n', '/imgStore/proImg/img143755554506953,/imgStore/proImg/img143755554507030,/imgStore/proImg/img143755554507008,/imgStore/proImg/img143755554507025', 'brandType143770259212008', 0.08, 978),
('brand16', '依诺维绅', '1', '/imgStore/logo/yiruoweishen.png', 'yinuoweishen', NULL, NULL, NULL, NULL, 'Y', 0.02, '丹麦依诺维绅是世界第一的功能沙发，每款都有不同的打开方式，满足您不同空间的使用需求，依诺维绅的颜色也是独一无二的，每年引领时尚潮流，无论放在您家中的哪个空间，都是一个完美的亮点。', '/imgStore/proImg/img143755518362840,/imgStore/proImg/img143755518362848,/imgStore/proImg/img143755518362912,/imgStore/proImg/img143755518362900', 'brandType143770240702051', 0.08, 152),
('brand17', '美洲生活', '1', '/imgStore/logo/meizhou.png', 'meizhoushenghuo', NULL, NULL, NULL, NULL, 'M', 0.02, '“美洲生活”是对美洲原滋原味休闲生活的诠释，把北美，自然、健康、人本化的生活理念带回到中国。“美洲生活”产品系列涵盖：家具、家纺、灯具、卫浴、饰品、窗帘、墙画和厨房用品等。每类产品都经过精心挑选和精雕细琢，确保国际一流的品质和超凡的价值，带给消费者丰富便捷的一体化购物体验。用最优质的材料和国际一流的产品设计，并保持最合理的价格，将休闲美式的唯美体验带给每一位客户。', '/imgStore/proImg/img143755123975265,/imgStore/proImg/img143755123975207,/imgStore/proImg/img143755123975273,/imgStore/proImg/img143755123975391', 'brandType143770259212008', 0.08, 458),
('brand18', '尚扑家（爱室丽）', '1', '/imgStore/logo/shanpu.png', 'shanpujia', NULL, NULL, NULL, NULL, 'S', 0.02, '自上世纪1945年创立至今，Ashley爱室丽家居已经从一家制作茶几和电视柜的手工作坊，发展成为世界排名第一的家具制造商和北美第一的家具零售商，闻名家居领域。1977年，Ashley爱室丽家居在阿拉斯加洲的安克雷奇，开设了他的首家家居零售卖场，此后迅速在全球壮大到近480家门店。\r\nAshley 美式简约\r\n专为日常生活设计的小美款式家具，满足他们对款式、舒适度和功能的需求。\r\nAshley 美式经典\r\n符合高雅品位的经典传统风格家具，精致优雅。\r\n', '/imgStore/proImg/img143755317578610,/imgStore/proImg/img143755317578690,/imgStore/proImg/img143755317578644,/imgStore/proImg/img143755317578701', 'brandType143770259212008', 0.08, 884),
('brand19', '大自然床垫', '1', '/imgStore/logo/daziran.png', 'daziran', NULL, NULL, NULL, NULL, 'D', 0.02, '贵州大自然科技有限公司是由国有上市公司南方汇通股份有限公司（SZ.000920）、广州乾鑫财税咨询公司、本公司经营团队等多方股东于2010年共同投资设立。\r\n　　公司前身为南方汇通股份有限公司棕纤维事业部，成立于1990年，是我国植物纤维床垫的发明者、开创者及领导者，是集生产、销售、研发为一体的专业公司。我公司已先后通过了ISO9001质量管理体系，ISO14001环境管理体系和OHSAS18001职业健康安全管理体系认证。公司积极实施专利技术战略，现已拥有各类专利86项，是国家知识产权产业化示范工程单位，是国家标准化管理委员会全国家具标准化技术委员会首批委员单位，主导起草了《棕纤维弹性床垫》行业标准，该标准已顺利升级为国家标准，\r\n　　公司秉承“天然、健康、安全、环保”的产品理念，全力打造“大自然”品牌，大自然床垫为公司拥有自主知识产权的高科技产品，其销售网络遍及全国各地，拥有近千万的使用者，在消费者中享有良好的口碑，已发展成为中国植物睡眠床垫的第一品牌，是消费者科学睡眠的首选。\r\n大自然床垫是由贵州大自然科技有限公司研发和生产的全植物纤维系列床垫。1990年第一张大自然棕纤维床垫下线至今已有20年的历史，在植物纤维床垫行业享有多项专利及产权。经过多年的不断发展，现今已发展成拥有梦境、幻境、心境、意境、梵境五大棕床垫系列为主的产品体系，同时还有医疗、宾馆、旅游、学生用、套房用等多种产品类型。\r\n', '/imgStore/proImg/img143754846787425,/imgStore/proImg/img143754846787479,/imgStore/proImg/img143754846787463,/imgStore/proImg/img143754846787524', 'brandType143770242970977', 0.08, 786),
('brand2', '索菲尼沙发', '1', '/imgStore/logo/suofeini.png', 'suofeini', NULL, NULL, NULL, NULL, 'S', 0.02, '索菲尼，一个意大利最具创造力和影响力的家具品牌。它经历了120年的发展时间，成为意大利家喻户晓的家具品牌，并逐渐走向世界，其品牌产品特点以完美、舒适、人性化为主要特点，品牌形象在意大利消费者的心里是完美的代名词。\r\n索菲尼创始人保罗•鲍乃弟是一个著名的建筑设计师，他在中国居住期间，设计了意租界、英租界、法租界的不少房屋，这些房屋充溢着南欧和意大利风格。其中最主要的设计“回力球场”非常的宏伟壮观，非常的时尚摩登，意大利的很多现代建筑也曾经出自他的设计，他一生游历了很多国家，在中国的经历，不管是在他的人生经历和创作经历中都是最重要的经历，晚年他一直住在意大利，对家具的喜爱与研究成了他唯一的精神支柱， 在佛罗伦萨位于郊区的大房子里，到处都有贴满了他手绘的家具手稿，在那些家具手稿中没有一种是传统生活中能够见到的家具样子，他手稿中的一个沙发可以有很多使用方法，可以变幻成工作台，可以变换成床，还可以变换成装饰房间的大饰品，也许在今天在我们看来这一切都是很正常的，在当时可是匪夷所思的，这位有着丰富人生阅历，有着极强创意精神的老人，他的手稿是他对生活概念的更高诠释，是灵魂追求至美至善的挥洒写意，也写满了对未来生活文明的期许……\r\n他的孙子保罗凯文，一个极富创造精神的银行职员，在上个世纪80年代，和他一起决定要把这些手稿变成可以让很多人触摸的到的产品，索菲尼就是在这个时期诞生的，索菲尼在起初的十几年也经历了很多风雨，当意大利近代文明开始复苏的时候，索菲尼慢慢的被一些有生活追求和生活理想的人认可，并逐渐受到追捧，他不断变换的产品功能和极具创意的唯美的外观设计，以及严谨的工艺和优良的材质，是意大利人生活的最高追求和向往，在20世纪末已经成为意大利追求生活品位的家庭首选产品。\r\n21世纪，索菲尼的现代掌门人保罗洛文，带着保罗•鲍乃弟把索菲尼带到中国的梦想，来考察中国市场，并寻找优秀的产品生产合作伙伴，在2003年的金秋，他来到了中国的家具制造基地，广东顺德，在重点考察企业的选择名单中，他选择了有着二十六年家具研发和生产的广东佛山韦富家具有限公司作为她的合作伙伴，索菲尼正式在中国生根开花，这个极富意大利创造精神的品牌将把中国的消费者带向一个灵性的生活空间，他至美，至纯的产品创作理念将成为中国消费者的生活天使。\r\n', '/imgStore/proImg/img143755385689655,/imgStore/proImg/img143755385689759,/imgStore/proImg/img143755385689710,/imgStore/proImg/img143755385689768', 'brandType143770240702051', 0.08, 656),
('brand20', '依丽思沙发', '1', '/imgStore/logo/elis.png', 'yilisishafa', NULL, NULL, NULL, NULL, 'Y', 0.02, '依丽思家居一直秉承以顾客的需求为企业努力方向的经营理念，自1993年创立以来始终专注于软体产品的设计、制造与销售。公司高薪聘请人体工程学、健康睡眠学、软体材料学等相关领域专家顾问，不断提升公司的产品设计与制造水平！经过依丽思人二十余年的艰苦奋斗和锐意创新，公司规模日益壮大，业绩蒸蒸日上！现已发展成为一家占地80000余平方米，家居领域的专业设计生产团队达400多人的现代化综合型家具企业。目前已建立遍布全国各地一、二级城市的庞大销售网络，成为广东省最具实力的软体品牌之一。作为中国本土知名软体品牌，依丽思家居根植中国放眼全球，打造出中国软体行业优秀的国际化品牌！\n依丽思家居在注重与国外设计大师合作的同时，也非常重视自主设计与创新，通过持续不断的努力，打造出依丽思、JD等系列中高端软体品牌，产品类别涵盖沙发、软床、床垫！从最开始着重于满足广大消费者基本的睡眠需求，到为顾客提供科学化、人性化的健康产品――我们一直在努力！\n随着企业的发展，我们不断在思考：顾客最核心的需求是什么呢？我们认为，顾客最核心的需求是安全、健康、性价比、优秀的设计以及使用产品带给顾客心理上的愉悦与满足！\n而这些需求用一个词来描述那就是――品位！依丽思家居通过打造有品位的产品品牌，给追求品位的顾客提供最优质的产品与服务！\n', '/imgStore/proImg/img143755476008104,/imgStore/proImg/img143755476008282,/imgStore/proImg/img143755476008285,/imgStore/proImg/img143755476008257', 'brandType143770240702051', 0.08, 621),
