('brand22', '卡昂', '1', '/imgStore/logo/img143749410571766', 'kaang', NULL, NULL, NULL, NULL, 'K', 0.02, '卡昂是一种生活态度，是一种心境，是一首生活的变奏曲，她稳重，知性，灵性，善解人意。卡昂家具选用国际高档面料，用料考究、款式新颖、做工精细、创意独特、典雅，品位高档，同时辅之以高科技的环保控制、先进工艺和色彩的综合应用，她经典、独特、工艺精湛、品质卓越，现代中体现着庄重，精致中展示着高雅。', '/imgStore/proImg/img143755014570596,/imgStore/proImg/img143755014570502,/imgStore/proImg/img143755014570501,/imgStore/proImg/img143755014570649', 'brandType143770240702051', 0.08, 242),
('brand23', '栖息地', '1', '/imgStore/logo/img143749538907477', 'qixidi', NULL, NULL, NULL, NULL, 'Q', 0.02, '栖息地 是2010年融峰国际家居联手美国著名设计师JOJO倾力打造的原汁原味现代简约美式家具典范\r\n倡导的是整体家居理念，轻装修、重装饰，色彩与时尚同步，把家居文化打造成时尚消费文化一样颇具诱惑力，深受现代都市年轻消费者的偏爱;栖息地 所销售的是“生活方式”，所倡导的是“生活品位”，强调二者结合，一站式购物在此可完美的体现.', '/imgStore/proImg/img143755283465428,/imgStore/proImg/img143755283465441,/imgStore/proImg/img143755283465599,/imgStore/proImg/img143755283465562', 'brandType143770259212008', 0.08, 253),
('brand24', '摩卡生活', '1', '/imgStore/logo/moka.png', 'moka', NULL, NULL, NULL, NULL, 'M', 0.02, '摩卡生活 平实的，纯粹的。一段天然木材，，浓郁稳重的胡桃色，雍容而深具韵味，她简约而不简单，深具现代审美观；略带深沉而不沉闷，充满油然而生的成熟美。\r\n\r\n德式的严谨工艺，东方的简洁大气，时尚的休闲舒适，实用的功能搭配。\r\n\r\n全实木质感，天然的纹理，传统的工艺，整齐的方榫，简介的框架，无不体现着现代人的环保、休闲生活作风。', '/imgStore/proImg/img143755160904928,/imgStore/proImg/img143755160904959,/imgStore/proImg/img143755160905063,/imgStore/proImg/img143755160905025', 'brandType143770259212008', 0.08, 668),
('brand25', '纯美世家', '1', '/imgStore/logo/img143749769394682', 'chunmei', NULL, NULL, NULL, NULL, 'C', 0.02, '纯美世家（NEW WORLD HOME）──顶级美式家具集成代理商，专营百年美国奢侈品牌。成立于2002年，拥有全球采购系统，不仅提供丰富独特的美式古典（CLASSIC）、新古典（NEO-CLASSIC）、乡村田园（COUNTRY）风格的高端家具，更以此为载体，积极倡导一种品味、个性的生活方式。', '/imgStore/proImg/img143754792473903,/imgStore/proImg/img143754792473969,/imgStore/proImg/img143754792474024,/imgStore/proImg/img143754792474001', 'brandType143770259212008', 0.08, 646),
('brand26', '楷模', '1', '/imgStore/logo/kaimo.png', 'kaimo', NULL, NULL, NULL, NULL, 'K', 0.02, '源于意大利，设计风格属于后现代主义，给您回归自然之感。楷模家具将中西两种文化巧妙相结合。充分体现人性特质，打破一成不变的视觉疲劳，楷模帮您回归自然淳朴。个性，就是与众不同迷人，就是非凡魅力落俗套的气质，叫人眼前一亮。当全新的家具创作意念与精湛的工艺在此相融，个性与迷人从此有了新定义。 楷模家具之所以能成为正是品牌制造的核心，能成为市场的推动力，是因为它所设计的每一个款式，都是非常非常贴近大众心理的。楷模家具将美与生活融于一体，处处心思凝聚，过目留神。唯有大匠索致以最舒服为目标，视觉的舒服、以及形体的舒服。处于时尚与古典的边缘，因此拥有最大限度的搭配自由。甚至空间的基础装修，如墙壁或地面，亦可自由发挥，尽显个性所能。', '/imgStore/proImg/img143755032449492,/imgStore/proImg/img143755032449521,/imgStore/proImg/img143755032449536,/imgStore/proImg/img143755032449528', 'brandType143770259212008', 0.1, 726),
