('brand28', '郎思博', '1', '/imgStore/logo/img143749438029173', 'langsibo', NULL, NULL, NULL, NULL, 'L', 0.02, '---朗思博\r\n贵族生活的新典范\r\n新经典主义风格的领航者\r\n寻求古典与现代、传统与\r\n时尚之间一种微妙的平衡\r\n最具美感的家具\r\n\r\n她，不只是产品，她还拥\r\n有四大核心优势：\r\n高品质产品生产工艺;\r\n完整的产品配套性;\r\n卓越的软装设计;\r\n可视化全屋定制服务\r\n打造创新家居一体化新模式\r\n', '/imgStore/proImg/img143755049513301,/imgStore/proImg/img143755049513434,/imgStore/proImg/img143755049513432', 'brandType143770259212008', 0.08, 355),
('brand29', '班尔奇', '1', '/imgStore/logo/banerqi.jpg', 'banerqi', NULL, NULL, NULL, NULL, 'B', 0.02, '作为中国大陆整体衣柜行业的第一批先行者，班尔奇自2003年成立之初就以时尚、品位、过人的品质和服务迅速打开中国市场，至今班尔奇的销售网络已覆盖除西藏、青海以外的二十九个省市自治区的省会及主要城市，截止至2012年底，班尔奇终端店面数量达到450余家，成为百安居中国收纳系统的全国指定供应商，红星美凯龙、居然之家和银座家居等知名建材市场的战略合作伙伴，美国迪士尼公司在中国市场的移门和小家具授权商，万科、世茂和绿城等全国性地产集团的战略配套供应商，并在精装房项目的收纳系统规划设计方面有突出表现，班尔奇毫无争议地成为整体衣柜和移门行业中公认的旗舰企业之一。', '/imgStore/proImg/img143754741927653,/imgStore/proImg/img143754741927634,/imgStore/proImg/img143754741927729,/imgStore/proImg/img143754741927775', 'brandType143770259212008', 0.08, 270),
('brand3', '梦百合', '1', '/imgStore/logo/mengbaihe.png', 'mengbaihe', NULL, NULL, NULL, NULL, 'M', 0.02, 'Mlily梦百合品牌诞生于2008年，自2011年登陆美国以来，连续三年销量增长超过100%，成为美国市场近三年来销量增长最快的床垫品牌之一，预计2016年进入美国床垫品牌前十名。2014年，Mlily梦百合重新规划产品线，将美国最畅销的几款床垫引入中国，并研发全球首张智能床垫，回馈国人。Mlily梦百合，致力于让每个人都能拥有健康的睡眠。', '/imgStore/proImg/img143755142415197,/imgStore/proImg/img143755142415166,/imgStore/proImg/img143755142415163,/imgStore/proImg/img143755142415126', 'brandType143770242970977', 0.08, 354),
('brand30', '汀·西海岸', '1', '/imgStore/logo/img143749813411837', 'tingxihaian', NULL, NULL, NULL, NULL, 'T', 0.02, '精选美国进口白蜡木“100%纯原木”打造而成\r\n\r\n美式基因 苏派工艺\r\n\r\n将美国西海岸文化及家具特色与国内消费者的生活状态及审美取向相结合，是为国内家具市场量身打造的具有美国家居风格的新美式纯原木家居产品', '/imgStore/proImg/img143755402898079,/imgStore/proImg/img143755402898181,/imgStore/proImg/img143755402898140,/imgStore/proImg/img143755402898152', 'brandType143770259212008', 0.08, 656),
('brand31', '宝恩', '1', '/imgStore/logo/bonliving.png', 'baoen', NULL, NULL, NULL, NULL, 'B', 0.02, '宝恩是目前国内为数不多的拥有高端皮革研发设计以及相关的皮革制品生产能力的大型集团公司，公司有着60年的皮革研发制造历史，产品远销欧美、中东地区多个国家，半个多世纪以来，宝恩已从当年的合作社模式，日产值百余元发展壮大到现在年销售额二十多亿元，业务版块涵盖OEM、高端皮革、皮艺家具、软体家具、包袋、明胶以及高档汽车坐垫、鞋面革等一系列的完整产业链，2002年及2012年人民大会堂政协常委会议厅和金色大厅座椅两次选用宝恩的产品，凭借着六十年的品牌文化沉淀以及超凡的皮革能力。\r\n      2012年，宝恩集团正式推出旗下原创高端皮艺家具品牌“BONLIVING”，风格主要分为三大系列：现代美式、后现代奢华主义以及风情系列，并首次大胆的将彩绘艺术巧妙的融入到产品设计中，致力于为全球家庭提供顶级奢华的皮艺生活。伟大的品牌离不开对原材料的苛求和对精湛工艺的不懈追求，所有“宝恩•BONLIVING”产品均只选用母公司专供的高等级皮革，精选力学性能优良的优质木材，经过万次机械冲压检测的高品质海绵和天然羽绒以及经过专业耐冲压测试的进口弹簧，全球著名公司的铆钉、拉链等材料，由经验丰富的工匠经过几百道工序严格纯手工制作完成，这其中绝大多数工序都需要由手工来完成的，力求每一件产品都独具匠心。\r\n   品质成就品牌。宝恩高品质的追求赢得了市场的信赖。今天，宝恩已经成为中国皮革行业和高端皮艺家具制造业的风向标，被誉为“皮艺家具领导者”。\r\n', '/imgStore/proImg/img143754778398400,/imgStore/proImg/img143754778398555,/imgStore/proImg/img143754778398597,/imgStore/proImg/img143754778398566', 'brandType143770259212008', 0.08, 136),
('brand32', '工艺大师', '1', '/imgStore/logo/gongyidashi.png', 'gongyidashi', NULL, NULL, NULL, NULL, 'G', 0.02, '上海申美沙发有限公司成立于1993年，是上海家具行业龙头企业之一，经过数十年的发展，现拥有20000多平方米厂房，和一大批数十年以上经验丰富的技术师。2003年申美沙发打造了“工艺大师”品牌，其欧式系列家具更是凭借持续的创新工艺和出色的品质一举建立了行业的领先地位。\r\n    企业成功通过了ISO9001:2000国际质量体系认证，连续多年荣获国家“A”级产品；荣获中国质量体系认证中心（CQC）签发的家具产品质量环保认证，成为上海首家沙发环保产品；每年均获得上海市家具行业协会“优秀产品奖”，“著名生产企业”，“名优产品企业”等荣誉称号。被上海市家具协会评为“推荐品牌”；上海市工商局、市消费者协会推荐为“倡导诚信企业”；国家质量监督检验中心定为产品质量定点检验单位；获得中国质量检验中心颁发的“中国质量环保产品认证证书”；先后被评为上海家具行业协会理事单位、常务理事单位、中国家具协会第四届理事会理事单位；中国家具协会常务理事单位等。\r\n    数十年来，申美公司不断壮大，在上海拥有20多家直营店，并在全国各地设立经销店。立足于国内销售市场的同时还开拓了国际市场，产品远销美国、加拿大、法国、英国、西班牙、澳大利亚、尼日利亚、日本、韩国等。\r\n    本公司秉承“客户至上”的经营理念，以“精益求精，以质求存”为质量方针，加以现代化的管理，创新的经营为基础，顺应时代潮流，奋斗拼搏，积极进取，不断推出国际上流行的最新风格、最新款式来满足消费者的需要。', '/imgStore/proImg/img143822535514103,/imgStore/proImg/img143822535514258,/imgStore/proImg/img143822535514251,/imgStore/proImg/img143822535514267', 'brandType143770259212008', 0.08, 353),
('brand33', '赖氏木业', '0', '/imgStore/logo/nologo.png', 'laisimuye', NULL, NULL, NULL, NULL, 'L', 0.02, '暂缺', '/imgStore/proImg/img143669785829533', NULL, NULL, 0),
('brand4', '英伦高尔夫', '1', '/imgStore/logo/gaoerfu.png', 'yinlun', NULL, NULL, NULL, NULL, 'Y', 0.02, '“英伦高尔夫床垫”创立于1998年，坐落于上海西郊松江工业园区内，是一家钻研人类睡眠文化，集生产、销售于一体的专业企业。\r\n15年来，公司一直坚持“采用核心技术、引进一流设备、注重研究睡眠”为发展战略核心，多次荣获国家专利，并针对不同领域（酒店、政府、别墅、社区、学校等）人群开发出多达上百款专用床垫，深受消费者的拥戴，目前在上海拥有40家直营店，力争2年内覆盖全国大、中城市，全力打造行业第一品牌。 \r\n床垫所有的生产环节全部由工厂自己生产，材料大批量采购也很节省成本，市场上同样的产品，我们的性价比绝对高于对方！\r\n', '/imgStore/proImg/img143755492523317,/imgStore/proImg/img143755492523422,/imgStore/proImg/img143755492523445,/imgStore/proImg/img143755492523419', 'brandType143770242970977', 0.08, 743),
('brand8', '弗沃德家居', '1', '/imgStore/logo/fuwode.png', 'foaode', NULL, NULL, NULL, NULL, 'F', 0.02, '“弗沃德”旗下美国后现代文化理念的Hason Furniture汉森（现代实木家具），采用了选自美国东部的黑胡桃木为主料，实现了木质特性和产品风格以及生活空间协调统一；奥地利现代典雅设计风格的Blook 布鲁克(后现代实木家具)，采用南美胡桃木秘鲁原生林木，将音乐和实木家具完美融合。', '/imgStore/proImg/img143754893759082,/imgStore/proImg/img143754893759173,/imgStore/proImg/img143754893759195,/imgStore/proImg/img143754893759119', 'brandType143770259212008', 0.08, 687),
('brand9', '木宝美家', '1', '/imgStore/logo/mubaomeijia.png', 'mubaomeijia', NULL, NULL, NULL, NULL, 'M', 0.02, '木宝美家是21年的红木新中式生产经验，木宝美家以缅甸黄金樟为主要原料，榫卯、雕刻国粹的工艺和技术，看起来含蓄内敛，富有内涵。\r\n', '/imgStore/proImg/img143755216279087,/imgStore/proImg/img143755216279156,/imgStore/proImg/img143755216279160,/imgStore/proImg/img143755216279159', 'brandType143770259212008', 0.08, 649);
